// Signin.jsx
import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../assets/App.css'; // Import CSS for styling

const Signin = () => {
  const navigate = useNavigate(); // Importing useNavigate hook

  const handleRegisterClick = () => {
    navigate('/register'); // Navigate to register page
  };

  return (
    <div className='booking_area w-full h-screen bg-gradient'>
      <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto flex justify-center items-center">
        <div className="signin-container bg-white rounded-lg shadow-lg p-8">
          <h2 className="text-2xl font-bold mb-4">Sign In</h2>
          <form className="mb-4">
            <div className="mb-4">
              <input type="text" placeholder="Username" required className="w-full px-3 py-2 border rounded-lg outline-none focus:border-blue-500" />
            </div>
            <div className="mb-4">
              <input type="password" placeholder="Password" required className="w-full px-3 py-2 border rounded-lg outline-none focus:border-blue-500" />
            </div>
            <button type="submit" className="w-full bg-blue-500 text-white py-2 rounded-lg hover:bg-blue-600 transition-colors">Sign In</button>
          </form>
          <p className="text-sm text-gray-600">Don't have an account? <Link to="/register" className="text-blue-500 hover:underline">Register here</Link></p>
        </div>
      </div>
    </div>
  );
};

export default Signin;
